import logo from './logo.svg';
import './App.css';
import {useState} from 'react';

const options=[
  {
    name:'Products',
    url:'https://dummyjson.com/docs/products'
  },
  {
    name:'Todos',
    url:'https://dummyjson.com/docs/todos'
  },
  {
    name:'posts',
    url:'https://dummyjson.com/docs/posts'
  }
]
function App() {
  const [inputValue, setInputValue] = useState('');

  const [outputValue, setOutputValue] = useState('Sample Text');

  const handleInputChange = (event) => {
    setInputValue(event.target.value);
  }

  const handleSubmit = () => {
    const url = `https://dummyjson.com/${inputValue}`;



    fetch(url)
    .then(response => response.json())
    .then(data => {
      setOutputValue(data.todos);
      console.log(outputValue)
    })
    .catch(error => console.error('Error:', error));
  }

  return (
    <div>
      <h2>Component A</h2>
      <label for="cars">Choose option</label>

      <select name="cars" id="cars" onChange={handleInputChange} >
        {options.map((option)=>(
          <option value={option.url}>{option.name}</option>
        ))}
      </select>

      <input type="text" value={inputValue} />
      <button onClick={handleSubmit}>Submit</button>
      <table border="1">
        <thead>
          <tr>
            <th>id</th>
            <th>todo</th>
            <th>completed</th>
            <th>userId</th>
          </tr>
            { outputValue.map((item)=>(
            <tr>
                <td>{item.id}</td>
                <td>{item.todo}</td>
                <td>{item.completed}</td>
               <td>{item.userId}</td>
             </tr> 
          ))}

        </thead>
        <tbody>

        </tbody>
      </table>
    </div>
  );
}
export default App;
